import React from 'react';
import './App.css';
import NavBar from "./components/Navbar/Navbar"
import Slider from "./components/Slider/Slider"
import Sales from "./components/Sales/Sales"

function App() {
  return (
    <div className="App">
      <NavBar />
      <Slider /> <Sales />
    </div>
  );
}

export default App;
